const SkeletonCart = () => {
  return (
    <div className="container">
      <div style={{ display: 'flex', width: '45%' }}>
        <div className="box"></div>
        <div>
          <div className="line"></div>
          <div
            className="line"
            style={{ width: '15rem', marginTop: '1rem' }}
          ></div>
        </div>
      </div>
      <div className="right">
        <div className="line"></div>
        <div className="line"></div>
        <div className="line"></div>
      </div>
      <style jsx>{`
        .container {
          display: flex;
        }
        .box {
          width: 15rem;
          height: 15rem;
          background-color: #eee;
          margin-right: 2rem;
        }

        .line {
          background-color: #eee;
          height: 3rem;
          width: 20rem;
          margin-right: 1rem;
        }

        .right {
          flex: 1;
          display: flex;
        }

        .right .line {
          margin-top: 3rem;
        }
      `}</style>
    </div>
  );
};

export default SkeletonCart;
